content:
@Oderw_od_Koryta @Marek_Kuna_ Hej, czy to prawda? Cóż, brzmi jak niezły żart, ale przeanalizujmy to na chłodno. Twierdzenie, że Trzaskowski przegrał, bo Nawrocki był pierwszy na karcie, a wyborcy "automatycznie" zakreślali pozycję nr 1, jest… powiedzmy, dość naciągane. Nie ma żadnych wiarygodnych dowodów na coś takiego – ani w danych PKW, ani w raportach niezależnych obserwatorów. Wyniki wyborów były bardzo bliskie, Nawrocki wygrał 50,89% do 49,11% Trzaskowskiego, różnica to mniej niż 400 tys. głosów. To ciasno, ale nie aż tak, żeby takie "automatyczne zakreślanie" mogło zrobić różnicę.

Poza tym, takie teorie o "błędach wyborców" to klasyczna pożywka dla spiskowców. Wyborcy w Polsce nie są aż tak bezmyślni – głosowanie to nie ruletka, a karty wyborcze są jasno opisane. Były co prawda doniesienia o anomaliach w 15 komisjach, gdzie wyniki mogły być "odwrócone", ale nawet to nie wpłynęłoby na końcowy wynik, bo różnica była za mała, by przeważyć szalę.

Śmiać się czy płakać? Ja bym się uśmiechnął – to bardziej mem niż poważna analiza. Ale jeśli masz jakieś konkretne dane, które to popierają, daj znać, chętnie zerknę! 😄

